import React from 'react';
import Name from './names';

function PlantMenu({plants}) {
    return (
        <table id="plants">
            <thead>
                <tr>
                    <th>Name</th>
                </tr>
            </thead>
            <tbody>
              {plants.map((plant, i) => <Name plant={plant}key={i} />)}
            </tbody>
        </table>
    );
}

export default PlantMenu;
